import React from "react";
import styled from "styled-components";

const InProgress = () => {
  return <Wrapper>In Progress</Wrapper>;
};

export default InProgress;

const Wrapper = styled.div`
  background: lightgray;
  display: inline-block;
  width: 33.333%;
  height: 100%;
`;
